import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import styled from "styled-components";

const useStyles = makeStyles(theme => ({
    appBar: {
        position: 'relative',
    },
    layout: {
        width: 'auto',
        marginLeft: theme.spacing(2),
        marginRight: theme.spacing(2),
        [theme.breakpoints.up(600 + theme.spacing(2) * 2)]: {
            width: 600,
            marginLeft: 'auto',
            marginRight: 'auto',
        },
    },
    paper: {
        marginTop: theme.spacing(3),
        marginBottom: theme.spacing(3),
        padding: theme.spacing(2),
        [theme.breakpoints.up(600 + theme.spacing(3) * 2)]: {
            marginTop: theme.spacing(6),
            marginBottom: theme.spacing(6),
            padding: theme.spacing(3),
        },
    },
    buttons: {
        display: 'flex',
        justifyContent: 'flex-end',
    },
    button: {
        marginTop: theme.spacing(3),
        marginLeft: theme.spacing(1),
    },
}));

const Copyright = styled(Typography)``

function SuggestForm() {
    return <>
        <Typography variant="h6" gutterBottom>
            Payment method
        </Typography>
        <Grid container spacing={3}>
            <Grid item xs={12}>
                <TextField
                    required
                    id="address1"
                    name="address1"
                    label="Address line 1"
                    fullWidth
                    autoComplete="billing address-line1"
                />
            </Grid>
            <Grid item xs={12}>
                <FormControlLabel
                    control={<Checkbox color="secondary" name="saveCard" value="yes"/>}
                    label="Remember credit card details for next time"
                />
            </Grid>
        </Grid>
    </>
}

function SuggestContainer() {
    const classes = useStyles();

    return (
        <>
            <CssBaseline/>
            <main className={classes.layout}>
                <Paper className={classes.paper}>
                    <Typography component="h1" variant="h4" align="center">
                        Моё письмо дизайнерам
                    </Typography>
                    <>
                        <SuggestForm/>
                        <div className={classes.buttons}>
                            <Button variant="contained" className={classes.button}>Предложить</Button>
                        </div>
                    </>
                </Paper>
                <Copyright variant="body2" color="textSecondary" align="center">
                    {`Copyright © Artworch ${new Date().getFullYear()}.`}
                </Copyright>
            </main>
        </>
    );
}

export default SuggestContainer
